import { Link } from "react-router-dom";


function Sidebar(){
    return <div className="sidebar">
        <h2>Sidebar</h2>
        <p><Link to="/home">Home</Link></p>
        <p><Link to="/about">About</Link></p>
        <p><Link to="/contact">Contact</Link></p>
    </div>
}

export default Sidebar;
